# [1234] 替换子串得到平衡字符串
#
# 1. 固定一个窗口大小，在这个窗口内的字串。向前滑动，比较。
# 2. 滑动距离可以做优化
# 3. 窗口大小扩张可以做优化
#
# Accepted
# 40/40 cases passed (788 ms)
# Your runtime beats 10.42 % of python3 submissions
# Your memory usage beats 25 % of python3 submissions (14.2 MB)
# @lc code=start


class Solution:

    def initDict(self):
        self.b_count = int(len(self.s) / 4)
        self.dict = {'Q': -self.b_count, 'W': -self.b_count,
                     'E': -self.b_count, 'R': -self.b_count}
        self.window_begin = 0
        self.window_end = 0

        for c in self.s:
            self.dict[c] += 1
        #print("s len: " + str(len(self.s)) + ", init dict: ", self.dict)
        return self.dict

    def balancedString(self, s: str) -> int:
        self.s = s
        self.initDict()
        if self.isBalanced():
            return 0

        min_window_size = self.calcInitWindowSize()
        #print("init window size: ", min_window_size)
        self.window_end = min_window_size
        self.updateState()
        # print(self.dict)
        # print(self.window_begin, self.window_end)
        if self.isBalanced():
            return self.window_end - self.window_begin
        iter_count_outer = 0
        while min_window_size < len(self.s):
            iter_count_outer += 1
            iter_count_inner = 0
            inner_min_window_size = min_window_size
            while True:
                iter_count_inner += 1
                if self.isBalanced():
                    #print("iter_count_outer: ", iter_count_outer)
                    return self.window_end - self.window_begin
                step = self.calcStep()
                #print("step: ", step)
                if inner_min_window_size > step:
                    inner_min_window_size = step
                if not self.moveWindowAndUpdate(step):
                    #print("    current dict: ", self.dict)
                    break
            self.initDict()
            min_window_size += inner_min_window_size
            self.window_end = min_window_size
            self.updateState()
            #print("    iter_count_inner: ", iter_count_inner, ", window size: ", min_window_size)

    def calcInitWindowSize(self) -> int:
        size = 0
        for value in self.dict.values():
            if value > 0:
                size += value
        return size

    def updateState(self):
        window = self.s[self.window_begin:self.window_end]
        # print("updateState, window: ", window)
        for c in window:
            self.dict[c] -= 1

    # 计算当前是否平衡，要考虑窗口
    def isBalanced(self) -> bool:
        for value in self.dict.values():
            if value > 0:
                return False
        return True

    # 根据 window 与 self.dict 计算向前滑动的距离
    def calcStep(self) -> int:
        step = 0
        for v in self.dict.values():
            if v > 0:
                step += v
        return step

    # 成功与否
    def moveWindowAndUpdate(self, step) -> bool:
        self.window_begin += step
        self.window_end += step
        if self.window_end > len(self.s):
            #print("window exceed s")
            return False
        pop_s = self.s[self.window_begin - step:self.window_begin]
        push_s = self.s[self.window_end - step:self.window_end]
        for c in pop_s:
            self.dict[c] += 1
        for c in push_s:
            self.dict[c] -= 1
        # print("moveWindowAndUpdate, pop: " +
        #     pop_s + ", push: " + push_s + ", current window: " +
        #     self.s[self.window_begin:self.window_end])
        # print(self.dict)
        return True
# @lc code=end


